Lesbian Sorority porn Nora (Skin Diamond) is the new girl on campus, and she knows to be weary of those sex-crazed, binge-drinking sororities. But when she meets Molly (Dani Daniels), she cant help wonder what really goes on behind those Greek letters. Meanwhile head sister Zelda (Melissa Jacobs) is pretty demanding to seduce some new recruits of her own. With other performances by Sinn Sage and Lily Labeau, Sweetheart is proud to bring you Volume 2 of Lesbian Sorority.
